func iconURI() string {
	iconFN := filepath.Join(config.Directory(), "passline-logo-small.png")
	if !fsutil.IsFile(iconFN) {
		fh, err := os.OpenFile(iconFN, os.O_WRONLY|os.O_CREATE, 0644)
		if err != nil {
			return ""
		}
		defer func() {
			_ = fh.Close()
		}()

		if err = bindataWrite(assetLogoSmallPng(), fh); err != nil {
			return ""
		}
		if err = fh.Close(); err != nil {
			return ""
		}
	}

	if fsutil.IsFile(iconFN) {
		return "file://" + iconFN
	}
	return ""
}

func bindataWrite(in []byte, out io.Writer) error {
	// gz, err := gzip.NewReader(bytes.NewBuffer(in))
	// if err != nil {
	// 	return err
	// }
	// defer func() {
	// 	_ = gz.Close()
	// }()

	_, err := io.Copy(out, bytes.NewBuffer(in))
	return err
}

